INSERT INTO `articles` (`id`, `title`, `slug`, `alias`, `description`, `image_url`, `cate_id`, `content`, `is_hot`, `project_id`, `type`, `status`, `display_order`, `meta_id`, `created_at`, `updated_at`, `created_user`, `updated_user`) VALUES
(1, 'Người hâm mộ đổ ra hồ Gươm ăn mừng thành tích của U23 Việt Nam', 'nguoi-ham-mo-do-ra-ho-guom-an-mung-thanh-tich-cua-u23-viet-nam', 'Nguoi ham mo do ra ho Guom an mung thanh tich cua U23 Viet Nam', 'Khoảng 100 xe máy đã chạy qua nhiều tuyến đường trung tâm Hà Nội để ăn mừng chiến tích lịch sử lọt vào tứ kết U23 châu Á của U23 Việt Nam.', '/public/uploads/images/tin-tuc/1_zing-1516245050.jpg', 10, '<table align=\"center\">\r\n	<tbody>\r\n		<tr>\r\n			<td>Ngay sau khi thầy tr&ograve; huấn luyện vi&ecirc;n Park Hang-seo c&oacute; trận h&ograve;a nghẹt thở với U23 Syria để qua đ&oacute; gi&agrave;nh v&eacute; v&agrave;o tứ kết giải U23 ch&acirc;u &Aacute;, người h&acirc;m mộ thủ đ&ocirc; đ&atilde; đổ ra đường mừng th&agrave;nh t&iacute;ch chưa từng c&oacute;.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Nguoi ham mo do ra ho Guom an mung thanh tich cua U23 Viet Nam hinh anh 2\" height=\"1314\" src=\"https://znews-photo-td.zadn.vn/w960/Uploaded/natmrb/2018_01_17/2_zing.jpg\" width=\"1920\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>C&aacute;c th&agrave;nh vi&ecirc;n hội cổ động vi&ecirc;n b&oacute;ng đ&aacute; Việt Nam (VFS) đ&atilde; đi ra hồ Ho&agrave;n Kiếm để ăn mừng.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Nguoi ham mo do ra ho Guom an mung thanh tich cua U23 Viet Nam hinh anh 3\" height=\"1457\" src=\"https://znews-photo-td.zadn.vn/w960/Uploaded/natmrb/2018_01_17/3_zing.jpg\" width=\"1920\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Đo&agrave;n xe nhanh ch&oacute;ng thu h&uacute;t sự ch&uacute; &yacute; của người đi đường v&agrave; ng&agrave;y c&agrave;ng trở n&ecirc;n đ&ocirc;ng hơn, c&oacute; l&uacute;c đến hơn 100 xe.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Nguoi ham mo do ra ho Guom an mung thanh tich cua U23 Viet Nam hinh anh 4\" height=\"1194\" src=\"https://znews-photo-td.zadn.vn/w960/Uploaded/natmrb/2018_01_17/4_zing.jpg\" width=\"1920\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Kh&ocirc;ng chỉ xe m&aacute;y, c&oacute; cả những chiếc &ocirc;t&ocirc; cũng mở cửa n&oacute;c, đứng l&ecirc;n cầm cờ v&agrave; li&ecirc;n tục h&ocirc; vang Việt Nam c&ugrave;ng t&ecirc;n c&aacute;c cầu thủ như Quang Hải, Xu&acirc;n Trường&hellip;.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Nguoi ham mo do ra ho Guom an mung thanh tich cua U23 Viet Nam hinh anh 5\" height=\"1323\" src=\"https://znews-photo-td.zadn.vn/w960/Uploaded/natmrb/2018_01_17/5_zing.jpg\" width=\"1920\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Qua c&aacute;c phố trung t&acirc;m như Đinh Ti&ecirc;n Ho&agrave;ng, L&yacute; Th&aacute;i Tổ, Tr&agrave;ng Tiền&hellip; đi đến đ&acirc;u, đo&agrave;n xe cũng nhận được sự cổ vũ của người d&acirc;n v&agrave; đ&ocirc;i khi l&agrave; cả người nước ngo&agrave;i.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Nguoi ham mo do ra ho Guom an mung thanh tich cua U23 Viet Nam hinh anh 6\" height=\"1314\" src=\"https://znews-photo-td.zadn.vn/w960/Uploaded/natmrb/2018_01_17/6_zing.jpg\" width=\"1920\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Cả một l&aacute;i xe &ocirc;m c&ocirc;ng nghệ cũng bỏ c&ocirc;ng việc để chạy theo ăn mừng.&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Nguoi ham mo do ra ho Guom an mung thanh tich cua U23 Viet Nam hinh anh 7\" height=\"1920\" src=\"https://znews-photo-td.zadn.vn/w960/Uploaded/natmrb/2018_01_17/7_zing.jpg\" width=\"1280\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Tạ Đ&igrave;nh Nghị, một th&agrave;nh vi&ecirc;n VFS đ&atilde; 3 năm chia sẻ: Cả nh&oacute;m tập hợp từ 18h30 để theo d&otilde;i trận đấu giữa Việt Nam v&agrave; Syria. Chứng kiến trận đấu qu&aacute; kịch t&iacute;nh, m&igrave;nh sung sướng kh&ocirc;ng n&oacute;i n&ecirc;n lời. Cả nh&oacute;m quyết định ra bờ hồ ăn mừng v&agrave; hy vọng trong trận tứ kết sẽ tiếp tục được ăn mừng th&ecirc;m lần nữa.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Việt H&ugrave;ng</p>\r\n', 0, NULL, 1, 1, 0, 8, '2018-01-18 10:21:31', '2018-01-18 10:21:31', 1, 1);
