(5, 'Chính sách bảo mật', 'Chinh sach bao mat', '', 'Ch&uacute;ng t&ocirc;i rất quan t&acirc;m đến quyền ri&ecirc;ng tư của qu&yacute; kh&aacute;ch khi qu&yacute; kh&aacute;ch sử dụng những dịch vụ của ch&uacute;ng t&ocirc;i.Ch&uacute;ng t&ocirc;i cũng hiểu rằng qu&yacute; kh&aacute;ch sẽ rất quan t&acirc;m đến việc những th&ocirc;ng tin m&agrave; qu&yacute; kh&aacute;ch cũng cấp cho ch&uacute;ng t&ocirc;i c&oacute; được bảo mật an to&agrave;n hay kh&ocirc;ng. V&agrave; ch&uacute;ng t&ocirc;i lu&ocirc;n muốn qu&yacute; kh&aacute;ch sẽ thật y&ecirc;n t&acirc;m v&agrave; tin tưởng khi tham gia c&aacute;c dịch vụ của ch&uacute;ng t&ocirc;i. V&igrave; vậy ch&uacute;ng t&ocirc;i cam kết sẽ khiến qu&yacute; kh&aacute;ch c&oacute; những trải nghiệm tuyệt vời nhất khi tham gia chương tr&igrave;nh của ch&uacute;ng t&ocirc;i với sự tin tưởng ho&agrave;n to&agrave;n.<br />\r\n&nbsp;<br />\r\nCh&uacute;ng t&ocirc;i rất quan t&acirc;m đến quyền ri&ecirc;ng tư của qu&yacute; kh&aacute;ch khi qu&yacute; kh&aacute;ch sử dụng những dịch vụ của ch&uacute;ng t&ocirc;i.Ch&uacute;ng t&ocirc;i cũng hiểu rằng qu&yacute; kh&aacute;ch sẽ rất quan t&acirc;m đến việc những th&ocirc;ng tin m&agrave; qu&yacute; kh&aacute;ch cũng cấp cho ch&uacute;ng t&ocirc;i c&oacute; được bảo mật an to&agrave;n hay kh&ocirc;ng. V&agrave; ch&uacute;ng t&ocirc;i lu&ocirc;n muốn qu&yacute; kh&aacute;ch sẽ thật y&ecirc;n t&acirc;m v&agrave; tin tưởng khi tham gia c&aacute;c dịch vụ của ch&uacute;ng t&ocirc;i. V&igrave; vậy ch&uacute;ng t&ocirc;i cam kết sẽ khiến qu&yacute; kh&aacute;ch c&oacute; những trải nghiệm tuyệt vời nhất khi tham gia chương tr&igrave;nh của ch&uacute;ng t&ocirc;i với sự tin tưởng ho&agrave;n to&agrave;n.<br />\r\n<br />\r\nCh&uacute;ng t&ocirc;i tạo ra ch&iacute;nh s&aacute;ch bảo mật n&agrave;y để chứng minh cho cam kết về sự an to&agrave;n bảo mật của c&ocirc;ng ty ch&uacute;ng t&ocirc;i với qu&yacute; kh&aacute;ch h&agrave;ng. Qua Ch&iacute;nh s&aacute;ch bảo mật th&ocirc;ng tin n&agrave;y, ch&uacute;ng t&ocirc;i muốn qu&yacute; kh&aacute;ch hiểu được về việc ch&uacute;ng t&ocirc;i thu thập th&ocirc;ng tin kh&aacute;ch h&agrave;ng, việc sử dụng v&agrave; chia sẻ th&ocirc;ng tin cũng như việc bảo mật th&ocirc;ng tin kh&aacute;ch h&agrave;ng của ch&uacute;ng t&ocirc;i. Ch&uacute;ng t&ocirc;i cũng hi vọng qu&yacute; kh&aacute;ch sẽ đọc thật kỹ những điều ch&uacute;ng t&ocirc;i m&ocirc; tả dưới đ&acirc;y:<br />\r\nThu Thập Th&ocirc;ng Tin<br />\r\n<br />\r\nCh&uacute;ng t&ocirc;i thu thập th&ocirc;ng tin từ tất cả những ai truy cập v&agrave; sử dụng nội dung dịch vụ của ch&uacute;ng t&ocirc;i, kể cả những Kh&aacute;ch gh&eacute; thăm kh&ocirc;ng đăng k&yacute; t&agrave;i khoản nhưng c&oacute; mua v&agrave; sử dụng c&aacute;c dịch vụ v&agrave; những Th&agrave;nh vi&ecirc;n của ch&uacute;ng t&ocirc;i.<br />\r\n<br />\r\nĐăng k&yacute;: C&aacute;c th&agrave;nh vi&ecirc;n c&oacute; thể sẽ được y&ecirc;u cầu cung cấp đầy đủ những th&ocirc;ng tin c&aacute; nh&acirc;n khi họ đăng kh&iacute; sử dụng những sản phẩm v&agrave; dịch vụ của ch&uacute;ng t&ocirc;i, bao gồm: t&ecirc;n, địa chỉ, số điện thoại v&agrave; th&ocirc;ng tin thanh to&aacute;n. Ch&uacute;ng t&ocirc;i sử dụng những th&ocirc;ng tin n&agrave;y chủ yếu để cung cấp những th&ocirc;ng tin hữu &iacute;ch nhất được cập nhật h&agrave;ng ng&agrave;y cho những kh&aacute;ch h&agrave;ng sử dụng dịch vụ của ch&uacute;ng t&ocirc;i, v&agrave; n&oacute;i chung, ch&uacute;ng t&ocirc;i kh&ocirc;ng bao giờ chia sẻ những th&ocirc;ng tin thu được n&agrave;y cho bất cứ b&ecirc;n thứ ba n&agrave;o.<br />\r\n<br />\r\nCh&uacute;ng t&ocirc;i sẽ lưu trữ to&agrave;n bộ những th&ocirc;ng tin truy cập cũng như phản hồi của kh&aacute;ch h&agrave;ng. Những th&ocirc;ng tin n&agrave;y được lưu trữ nhằm mục đ&iacute;ch chăm s&oacute;c tốt hơn cho những kh&aacute;ch h&agrave;ng của ch&uacute;ng t&ocirc;i.<br />\r\n<br />\r\nCh&uacute;ng t&ocirc;i sẽ lưu trữ tất cả những h&oacute;a đơn chứng từ mua b&aacute;n, giao dịch, lịch sử mua h&agrave;ng, phương thức thanh to&aacute;n &hellip; nhằm tr&aacute;nh những ph&aacute;t sinh đ&aacute;ng tiếc nếu c&oacute; sau n&agrave;y.<br />\r\n&nbsp;<br />\r\nSử Dụng V&agrave; Chia Sẻ Th&ocirc;ng Tin<br />\r\n<br />\r\nSử Dụng Th&ocirc;ng Tin: Ch&uacute;ng t&ocirc;i sử dụng th&ocirc;ng tin kh&aacute;ch h&agrave;ng cho những mục đ&iacute;ch sau:<br />\r\nCung cấp những th&ocirc;ng tin hữu &iacute;ch nhằm chăm s&oacute;c tốt nhất cho kh&aacute;ch h&agrave;ng, bao gồm: &nbsp;Bản tin h&agrave;ng ng&agrave;y (Newsletter), C&aacute;c chương tr&igrave;nh khuyến m&atilde;i, Th&ocirc;ng tin về sản phẩm mới hoặc c&aacute;c chương tr&igrave;nh th&uacute;c đẩy ph&aacute;t triển kh&aacute;c của c&ocirc;ng ty ch&uacute;ng t&ocirc;i. Cung cấp một số tiện &iacute;ch cũng như c&aacute;c dịch vụ tư vấn hỗ trợ kh&aacute;ch h&agrave;ng tốt hơn. Ch&uacute;ng t&ocirc;i sẽ sử dụng th&ocirc;ng tin kh&aacute;ch h&agrave;ng một c&aacute;ch hợp l&yacute; v&igrave; mục đ&iacute;ch ph&aacute;t triển v&agrave; ho&agrave;n thiện những dịch vụ của c&ocirc;ng ty để c&oacute; thể phục vụ tốt hơn qu&yacute; kh&aacute;ch h&agrave;ng.<br />\r\nGiải quyết những vấn đề tranh chấp, khiếu nại, giải đ&aacute;p thắc mắc của kh&aacute;ch h&agrave;ng.<br />\r\nPh&ograve;ng tr&aacute;nh những trường hợp đ&aacute;ng tiếc c&oacute; thể xảy ra sau n&agrave;y như những h&agrave;nh vi vi phạm ph&aacute;p luật.<br />\r\n<br />\r\nChia Sẻ Th&ocirc;ng Tin: Như đ&atilde; n&oacute;i, ch&uacute;ng t&ocirc;i rất coi trọng việc bảo mật th&ocirc;ng tin kh&aacute;ch h&agrave;ng n&ecirc;n ch&uacute;ng t&ocirc;i cam kết sẽ tuyệt đối kh&ocirc;ng tự &yacute; sử dụng th&ocirc;ng tin kh&aacute;ch h&agrave;ng với mục đ&iacute;ch kh&ocirc;ng mang lại lợi &iacute;ch cho kh&aacute;ch h&agrave;ng, ch&uacute;ng t&ocirc;i cam kết kh&ocirc;ng bu&ocirc;n b&aacute;n, trao đổi th&ocirc;ng tin bảo mật của kh&aacute;ch h&agrave;ng cho bất cứ b&ecirc;n thứ ba n&agrave;o. Tuy nhi&ecirc;n, trong một số trường hợp đặc biệt sau, ch&uacute;ng t&ocirc;i c&oacute; thể chia sẻ th&ocirc;ng tin kh&aacute;ch một c&aacute;ch hợp l&yacute;:<br />\r\nĐược sự đồng &yacute; của kh&aacute;ch h&agrave;ng.<br />\r\n<br />\r\nĐể bảo vệ quyền lợi của c&ocirc;ng ty v&agrave; những đối t&aacute;c của c&ocirc;ng ty: Ch&uacute;ng t&ocirc;i chỉ đưa ra những th&ocirc;ng tin c&aacute; nh&acirc;n của kh&aacute;ch h&agrave;ng khi chắc chắn rằng những th&ocirc;ng tin đ&oacute; c&oacute; thể bảo vệ được quyền lợi, t&agrave;i sản của c&ocirc;ng ty ch&uacute;ng t&ocirc;i v&agrave; những đối t&aacute;c li&ecirc;n quan. Những th&ocirc;ng tin n&agrave;y sẽ được tiết lộ một c&aacute;ch hợp ph&aacute;p theo Ph&aacute;p luật Việt Nam.<br />\r\nTheo y&ecirc;u cầu của những cơ quan ch&iacute;nh phủ khi ch&uacute;ng t&ocirc;i thấy n&oacute; ph&ugrave; hợp với ph&aacute;p luật Việt Nam.<br />\r\n<br />\r\nTrong một số trường hợp cần thiết phải cung cấp th&ocirc;ng tin kh&aacute;ch h&agrave;ng kh&aacute;c, như c&aacute;c chương tr&igrave;nh khuyến m&atilde;i c&oacute; sự t&agrave;i trợ của một b&ecirc;n thứ ba chẳng hạn, ch&uacute;ng t&ocirc;i sẽ th&ocirc;ng b&aacute;o cho qu&yacute; kh&aacute;ch h&agrave;ng trước khi th&ocirc;ng tin của qu&yacute; kh&aacute;ch được chia sẻ. Q&uacute;y kh&aacute;ch c&oacute; quyền quyết định xem c&oacute; đồng &yacute; chia sẻ th&ocirc;ng tin hoặc tham gia hay kh&ocirc;ng.<br />\r\nBảo Mật Th&ocirc;ng Tin Kh&aacute;ch H&agrave;ng<br />\r\n<br />\r\nCh&uacute;ng t&ocirc;i cam kết bảo đảm an to&agrave;n th&ocirc;ng tin cho qu&yacute; kh&aacute;ch h&agrave;ng khi đăng k&yacute; th&ocirc;ng tin c&aacute; nh&acirc;n với c&ocirc;ng ty ch&uacute;ng t&ocirc;i. Ch&uacute;ng t&ocirc;i cam kết kh&ocirc;ng trao đổi mua b&aacute;n th&ocirc;ng tin kh&aacute;ch h&agrave;ng v&igrave; mục đ&iacute;ch thương mại. Mọi sự chia sẻ v&agrave; sử dụng th&ocirc;ng tin kh&aacute;ch h&agrave;ng ch&uacute;ng t&ocirc;i cam kết thực hiện theo ch&iacute;nh s&aacute;ch bảo mật của c&ocirc;ng ty. Ch&uacute;ng t&ocirc;i cam kết sẽ khiến qu&yacute; kh&aacute;ch cảm thấy tin tưởng v&agrave; h&agrave;i l&ograve;ng về bảo mật th&ocirc;ng tin c&aacute; nh&acirc;n khi tham gia v&agrave; sử dụng những dịch vụ của c&ocirc;ng ty ch&uacute;ng t&ocirc;i.<br />\r\n<br />\r\nĐể bảo mật th&ocirc;ng tin của kh&aacute;ch h&agrave;ng tốt nhất, ch&uacute;ng t&ocirc;i khuyến c&aacute;o qu&yacute; kh&aacute;ch hạn chế truy cập t&agrave;i khoản bằng đăng nhập tự động, ch&uacute; &yacute; chế độ sao lưu password v&agrave; đảm bảo đăng xuất khỏi t&agrave;i khoản khi sử dụng m&aacute;y t&iacute;nh chung để đăng nhập t&agrave;i khoản tr&ecirc;n website của ch&uacute;ng t&ocirc;i. Ch&uacute;ng t&ocirc;i sẽ kh&ocirc;ng chịu tr&aacute;ch nhiệm khi những th&ocirc;ng tin c&aacute; nh&acirc;n của qu&yacute; kh&aacute;ch bị r&ograve; rỉ v&igrave; những l&yacute; do tr&ecirc;n.<br />\r\n<br />\r\nCh&iacute;nh s&aacute;ch bảo mật chỉ &aacute;p dụng những th&ocirc;ng tin qu&yacute; kh&aacute;ch h&agrave;ng đăng k&yacute; tr&ecirc;n website ch&iacute;nh thức Thanhphuthinhland.vn của c&ocirc;ng ty ch&uacute;ng t&ocirc;i. Mọi th&ocirc;ng tin qu&yacute; kh&aacute;ch đăng k&yacute; tại những website hoặc những địa chỉ kh&aacute;c đều kh&ocirc;ng thuộc phạm vi hiệu lực của Ch&iacute;nh s&aacute;ch bảo mật th&ocirc;ng tin n&agrave;y.&nbsp;<br />\r\n<br />\r\nCh&uacute;ng t&ocirc;i lu&ocirc;n nhấn mạnh khẳng định rằng: Ch&uacute;ng t&ocirc;i rất coi trọng quyền lợi được bảo mật th&ocirc;ng tin của qu&yacute; kh&aacute;ch h&agrave;ng. Nếu như qu&yacute; kh&aacute;ch c&oacute; bất cứ thắc mắc hay g&oacute;p &yacute; n&agrave;o li&ecirc;n quan đến Ch&iacute;nh s&aacute;ch bảo mật của c&ocirc;ng ty, vui l&ograve;ng li&ecirc;n hệ với ch&uacute;ng t&ocirc;i:', '', 'chinh-sach-bao-mat', 1, '', '', '', '', 1, 1, '2017-07-21 17:35:33', '2017-07-21 17:35:33'),
(7, 'TUYỂN DỤNG  NHÂN VIÊN KINH DOANH BĐS', 'TUYEN DUNG  NHAN VIEN KINH DOANH BDS', '', '&nbsp;\r\n<h4><span style=\"font-size:22px\"><span style=\"color:#3300ff\"><strong>TUYỂN GẤP 10 NH&Acirc;N VI&Ecirc;N KINH DOANH BĐS</strong></span></span></h4>\r\n&nbsp;\r\n\r\n<ul>\r\n	<li><span style=\"color:#d35400\"><span style=\"font-size:18px\"><strong><em>M&Ocirc; TẢ C&Ocirc;NG VIỆC:</em></strong></span></span></li>\r\n</ul>\r\n<br />\r\n<span style=\"font-size:16px\"><span style=\"color:#000000\">+ T&igrave;m kiếm kh&aacute;ch h&agrave;ng tiềm năng<br />\r\n+ Gọi điện chăm s&oacute;c kh&aacute;ch h&agrave;ng theo data c&ocirc;ng ty v&agrave; kh&aacute;ch h&agrave;ng tiềm năng<br />\r\n+&nbsp;</span><a href=\"http://mywork.com.vn/tuyen-dung/63/tu-van.html\"><span style=\"color:#000000\">Tư vấn</span></a><span style=\"color:#000000\">&nbsp;th&ocirc;ng tin cho kh&aacute;ch h&agrave;ng; đăng tin tr&ecirc;n web, diễn đ&agrave;n&hellip; về c&aacute;c&nbsp;</span><a href=\"http://mywork.com.vn/tuyen-dung/78/hoach-dinh-du-an.html\"><span style=\"color:#000000\">dự &aacute;n</span></a><span style=\"color:#000000\">&nbsp;bất động sản của c&ocirc;ng ty.<br />\r\n+ Kh&ocirc;ng c&oacute; kinh nghiệm sẽ được&nbsp;</span><a href=\"http://mywork.com.vn/tuyen-dung/58/giao-duc-dao-tao.html\"><span style=\"color:#000000\">đ&agrave;o tạo</span></a><span style=\"color:#000000\">, hướng dẫn k&egrave;m trực tiếp khi l&agrave;m việc</span></span><span style=\"color:#000000\">.&nbsp;&nbsp;</span><br />\r\n&nbsp;\r\n<ul>\r\n	<li><span style=\"font-size:18px\"><em><strong><span style=\"color:#d35400\">QUYỀN LỢI:</span></strong></em></span></li>\r\n</ul>\r\n&nbsp;\r\n\r\n<p><span style=\"font-size:16px\"><span style=\"color:#000000\">+ Lương cơ bản : 5tr/th&aacute;ng<br />\r\n+ Hoa hồng 2-5%/sản phẩm (15-30triệu) + thưởng n&oacute;ng<br />\r\n+ Được hỗ trợ tiền Maketting<br />\r\n+ Được hỗ trợ sim điện thoại gọi miễn ph&iacute;<br />\r\n+Chế độ đ&atilde;i ngộ tốt từ c&ocirc;ng ty: mừng sinh nhật, kết h&ocirc;n, thưởng ng&agrave;y lễ, tết, lương th&aacute;ng 13, thưởng hiệu quả c&ocirc;ng việc, ...<br />\r\n+&nbsp;</span><a href=\"http://mywork.com.vn/tuyen-dung/89/moi-truong.html\"><span style=\"color:#000000\">M&ocirc;i trường</span></a><span style=\"color:#000000\">&nbsp;l&agrave;m việc chuy&ecirc;n nghiệp, nh&acirc;n vi&ecirc;n năng động, th&acirc;n thiện;<br />\r\n+ Cơ hội l&agrave;m việc&nbsp;gắn b&oacute; l&acirc;u d&agrave;i v&agrave; thăng tiến.</span></span><br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li><span style=\"font-size:18px\"><span style=\"color:#d35400\"><em><strong>Y&Ecirc;U CẦU:</strong></em></span></span></li>\r\n</ul>\r\n<br />\r\n<span style=\"font-size:16px\"><span style=\"color:#000000\">+ Tuổi từ 18-35 tuổi. Tốt ngiệp THPT trở l&ecirc;n. ( Kh&ocirc;ng c&oacute; kinh nghiệm sẽ được đ&agrave;o tạo )<br />\r\n+ Biết sử dụng m&aacute;y t&iacute;nh, biết viết b&agrave;i đăng tin&nbsp;</span><a href=\"http://mywork.com.vn/tuyen-dung/44/tiep-thi-quang-cao.html\"><span style=\"color:#000000\">quảng c&aacute;o</span></a><span style=\"color:#000000\">&nbsp;sp.<br />\r\n+ C&oacute; laptop c&aacute; nh&acirc;n<br />\r\n+ C&oacute; kỹ năng giao tiếp tốt, tư vấn, xử l&yacute; t&igrave;nh huống tốt.<br />\r\n+ Năng động, tự tin, c&oacute; khả năng l&agrave;m việc độc lập v&agrave; theo nh&oacute;m.<br />\r\n+ C&oacute; tinh thần học hỏi.</span></span><br />\r\n&nbsp;\r\n<ul>\r\n	<li><span style=\"font-size:18px\"><em><strong><span style=\"color:#d35400\">HỒ SƠ:</span></strong></em></span></li>\r\n</ul>\r\n\r\n<p><br />\r\n<span style=\"color:#000000\">-<span style=\"font-size:16px\"> Đơn xin việc.<br />\r\n- Sơ yếu l&yacute; lịch.<br />\r\n- Hộ khẩu, chứng minh nh&acirc;n d&acirc;n v&agrave; giấy kh&aacute;m sức khỏe.<br />\r\n- C&aacute;c bằng cấp c&oacute; li&ecirc;n quan.</span></span><br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li><span style=\"color:#d35400\"><span style=\"font-size:18px\"><em><strong>TH&Ocirc;NG TIN LI&Ecirc;N HỆ:</strong></em></span></span></li>\r\n</ul>\r\n<br />\r\n<span style=\"font-size:16px\"><strong>Ms</strong>: </span><span style=\"font-size:18px\">Trần Thị Việt Kiều</span><br />\r\n<span style=\"font-size:16px\"><strong>ĐT</strong>: </span><span style=\"font-size:20px\"><span style=\"color:#cc0000\"><strong>0917.80.66.59</strong></span></span><br />\r\n<span style=\"font-size:16px\"><strong>Gmail</strong>: Trankieuvan2017@gmail.com</span><br />\r\n&nbsp;\r\n<ul>\r\n	<li><span style=\"color:#d35400\"><span style=\"font-size:18px\"><em><strong>&nbsp;NƠI L&Agrave;M VIỆC:</strong></em></span></span></li>\r\n</ul>\r\n<br />\r\n<strong><span style=\"font-size:18px\">C&Ocirc;NG TY TNHH DỊCH VỤ TƯ VẤN BẤT ĐỘNG SẢN THANH PH&Uacute; THỊNH LAND</span><br />\r\n<span style=\"font-size:18px\"><u>Địa chỉ</u>:</span>&nbsp;</strong><span style=\"font-size:16px\"><strong>Số 11 Đường 3052 Phạm Thế Hiển, Phường 7, Quận 8,HCM</strong></span><br />\r\n&nbsp;\r\n<ul>\r\n	<li><span style=\"color:#d35400\"><em><strong><span style=\"font-size:18px\">HẠN NỘP HỒ SƠ: 31/08/2017</span></strong></em></span></li>\r\n</ul>\r\n<br />\r\n&nbsp;', '2017/08/18/1-1503027310.jpg', 'tuyen-nhan-vien-kinh-doanh-bds', 1, '', '', '', '', 1, 1, '2017-08-18 11:03:56', '2017-08-18 15:36:58'),
(8, 'TIN TUYỂN DỤNG THÁNG 9 ( ĐI LÀM NGAY KHI TRÚNG TUYỂN )', 'TIN TUYEN DUNG THANG 9 ( DI LAM NGAY KHI TRUNG TUYEN )', '', '<img alt=\"\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f33/1/16/2705.png\" style=\"height:16px; width:16px\" />&nbsp;<span style=\"color:#2980b9\"><span style=\"font-size:20px\"><strong><em>CẦN TUYỂN GẤP 10 NH&Acirc;N VI&Ecirc;N KINH DOANH BẤT ĐỘNG SẢN</em></strong></span></span><br />\r\n<br />\r\n<img alt=\"\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f33/1/16/2705.png\" style=\"height:16px; width:16px\" />&nbsp;<span style=\"font-size:20px\"><strong>Cơ hộ</strong>i </span>&nbsp;<span style=\"font-size:16px\">t&igrave;m được 1 một c&ocirc;ng việc</span> <strong>V&Ocirc; C&Ugrave;NG HẤP DẪN</strong><span style=\"font-size:16px\"> với</span> <strong>MỨC THU NHẬP</strong> <span style=\"font-size:16px\">theo năng lực, m&ocirc;i trường l&agrave;m việc m&agrave;</span> <strong>BẤT KỲ AI</strong> <span style=\"font-size:16px\">đều mong muốn v&agrave; l&agrave; nơ</span>i <strong>Đ&Aacute;NG ĐỂ L&Agrave;M VIỆC<span style=\"font-size:16px\">,</span></strong>&nbsp;<strong>G&Acirc;Y DỰNG SỰ NGHIỆP</strong> <span style=\"font-size:16px\">v&agrave; </span><strong>PH&Aacute;T TRIỂN BẢN TH&Acirc;N</strong>&nbsp;<br />\r\n<span style=\"font-size:16px\">Ch&uacute;ng t&ocirc;i đ&atilde; t&igrave;m được 1 nơi l&agrave;m việc thật tuyệt vời như vậy ! <span style=\"color:#ff0000\"><strong>C&ograve;n c&aacute;c bạn th&igrave; sao???</strong></span></span><br />\r\n------------------------------------------------------------------<br />\r\n<img alt=\"\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f6c/1/16/2764.png\" style=\"height:16px; width:16px\" />&nbsp;<span style=\"font-size:18px\"><strong>C&Ocirc;NG VIỆC CH&Iacute;NH</strong></span><br />\r\n<br />\r\n<img alt=\"\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f33/1/16/2705.png\" style=\"height:16px; width:16px\" />&nbsp;<span style=\"font-size:16px\">T&igrave;m kiếm kh&aacute;ch h&agrave;ng tiềm năng<br />\r\n<img alt=\"\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f33/1/16/2705.png\" style=\"height:16px; width:16px\" />&nbsp;Gọi điện chăm s&oacute;c kh&aacute;ch h&agrave;ng ( c&ocirc;ng ty hỗ trợ data kh&aacute;ch h&agrave;ng tiềm năng )<br />\r\n<img alt=\"\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f33/1/16/2705.png\" style=\"height:16px; width:16px\" />&nbsp;Tư vấn&nbsp;th&ocirc;ng tin sản phẩm cho kh&aacute;ch h&agrave;ng<br />\r\n<img alt=\"\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f33/1/16/2705.png\" style=\"height:16px; width:16px\" />&nbsp;Đăng tin l&ecirc;n diễn đ&agrave;n rao vặt</span><br />\r\n------------------------------------------------------------------<br />\r\n<img alt=\"\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f6c/1/16/2764.png\" style=\"height:16px; width:16px\" />&nbsp;<span style=\"font-size:18px\"><strong>QUYỀN LỢ</strong>I</span><br />\r\n<br />\r\n<img alt=\"\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f33/1/16/2705.png\" style=\"height:16px; width:16px\" />&nbsp;L<span style=\"font-size:16px\">ương cơ bản : 5 triệu<br />\r\n<img alt=\"\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f33/1/16/2705.png\" style=\"height:16px; width:16px\" />&nbsp;Hoa hồng 2-5%/sản phẩm (15-30triệu) + thưởng n&oacute;ng<br />\r\n<img alt=\"\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f33/1/16/2705.png\" style=\"height:16px; width:16px\" />&nbsp;Được hỗ trợ chi ph&iacute; Marketing<br />\r\n<img alt=\"\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f33/1/16/2705.png\" style=\"height:16px; width:16px\" />&nbsp;Được hỗ trợ sim gọi kh&aacute;ch h&agrave;ng<br />\r\n<img alt=\"\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f33/1/16/2705.png\" style=\"height:16px; width:16px\" />&nbsp;M&ocirc;i trường l&agrave;m việc năng động, trẻ trung - &nbsp;<strong>RẤT</strong> <strong>Đ&Aacute;NG ĐỂ</strong>&nbsp;c&aacute;c bạn thử th&aacute;ch bản th&acirc;n.<br />\r\n<img alt=\"\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f33/1/16/2705.png\" style=\"height:16px; width:16px\" />&nbsp;Kh&ocirc;ng c&oacute; kinh nghiệm sẽ được&nbsp;đ&agrave;o tạo ( kỹ năng sale &amp; marketing online )</span><br />\r\n<img alt=\"\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f33/1/16/2705.png\" style=\"height:16px; width:16px\" />&nbsp;<span style=\"font-size:16px\">Đội ngũ nh&acirc;n vi&ecirc;n ( to&agrave;n trai xinh g&aacute;i đẹp ) h&ograve;a đồng, th&acirc;n thiện.<br />\r\n<img alt=\"\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f33/1/16/2705.png\" style=\"height:16px; width:16px\" />&nbsp;Được đi du lịch, tham gia hoạt động teambuilding của c&ocirc;ng ty mỗi năm.<br />\r\n<img alt=\"\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f33/1/16/2705.png\" style=\"height:16px; width:16px\" />&nbsp;Cơ hội <strong>L&Agrave;M VIỆC CH&Iacute;NH THỨC</strong> với thu nhập <strong>KH&Ocirc;NG THỂ HẤP DẪN HƠN</strong> trong tầm tay bạn.</span><br />\r\n<span style=\"font-size:16px\">------------------------------------------------------------------</span><br />\r\n<img alt=\"\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f6c/1/16/2764.png\" style=\"height:16px; width:16px\" />&nbsp;<span style=\"font-size:18px\"><strong>ĐỐI TƯỢNG</strong></span><br />\r\n<br />\r\n<img alt=\"\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f33/1/16/2705.png\" style=\"height:16px; width:16px\" />&nbsp;<span style=\"font-size:16px\">Nam/nữ, độ tuổi từ 18-28 tuổi,&nbsp;<br />\r\n<img alt=\"\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f33/1/16/2705.png\" style=\"height:16px; width:16px\" />&nbsp;KH&Ocirc;NG y&ecirc;u cầu kinh nghiệm<br />\r\n<img alt=\"\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f33/1/16/2705.png\" style=\"height:16px; width:16px\" />&nbsp;Tốt nghiệp từ THPT trở l&ecirc;n<br />\r\n<img alt=\"\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f33/1/16/2705.png\" style=\"height:16px; width:16px\" />&nbsp;Nhanh nhẹn, hoạt ng&ocirc;n, tự tin trong giao tiếp, c&oacute; tr&aacute;ch nhiệm với c&ocirc;ng việc</span><br />\r\n------------------------------------------------------------------<br />\r\n<img alt=\"\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f6c/1/16/2764.png\" style=\"height:16px; width:16px\" /><span style=\"font-size:18px\">&nbsp;<strong>HẠN NỘP HỒ SƠ: 30/09/2017</strong></span><br />\r\n<br />\r\n<strong><span style=\"font-size:18px\">N</span><span style=\"font-size:16px\">hanh tay gửi CV về cho ch&uacute;ng t&ocirc;i:</span></strong><br />\r\n<strong style=\"font-size:16px\">+ Gmail</strong><span style=\"font-size:16px\">:&nbsp;Trankieuvan2017@gmail.com</span><br />\r\n<strong style=\"font-size:16px\">+ Ms</strong><span style=\"font-size:16px\">:&nbsp;Trần Thị Việt Kiều</span><br />\r\n<strong style=\"font-size:16px\">+ ĐT</strong><span style=\"font-size:16px\">:&nbsp;</span><strong style=\"font-size:16px\">0917.80.66.59</strong><br />\r\n<strong><span style=\"font-size:16px\">+&nbsp;<u>Địa chỉ</u>:&nbsp;</span></strong><span style=\"font-size:16px\"><strong>Số 11 Đường 3052 Phạm Thế Hiển, Phường 7, Quận 8, HCM<br />\r\n<u>Wedside</u>: Thanhphuthinhland.vn</strong></span><br />\r\n<br />\r\n<span style=\"font-size:18px\">Đến với&nbsp;<span style=\"color:#d35400\"><strong>Thanh Ph&uacute; Thịnh Land</strong></span> bạn sẽ được l&agrave;m việc trong m&ocirc;i trường đầy năng động, nh&acirc;n vi&ecirc;n h&ograve;a đồng v&agrave; vui vẻ. Wellcome</span>', '', 'tuyen-gap-nhan-vien-kinh-doanh-bds', 1, '', '', '', '', 1, 1, '2017-09-15 11:50:19', '2017-09-15 17:22:36'),
(9, 'Nhận ký gửi nhà đất', 'Nhan ky gui nha dat', 'Giải quyết nỗi lo lắng về đầu ra cho bất động sản', '► Giải quyết đầu ra bất động sản nhanh gọn lẹ l&agrave; thế mạnh của ch&uacute;ng t&ocirc;i.<br />\r\n<br />\r\n► Nhưng đa số c&aacute;c vị kh&aacute;ch của ch&uacute;ng t&ocirc;i lại gặp rất nhiều c&aacute;c rắc rối. Ch&uacute;ng t&ocirc;i hiểu 1 l&yacute; do đơn giản: đ&oacute; kh&ocirc;ng phải l&agrave; chuy&ecirc;n m&ocirc;n thực sự của họ.\r\n<blockquote>\r\n<p>- B&aacute;n được t&agrave;i sản nhanh, gi&aacute; tốt m&agrave; kh&ocirc;ng bị l&agrave;m phiền bởi c&aacute;c vị kh&aacute;ch th&iacute;ch d&ograve; nh&agrave; đ&oacute; điều rất kh&oacute; trong thời buổi c&ocirc;ng nghệ đăng tin tr&agrave;n lan như hiện nay.<br />\r\n<br />\r\n- Thiếu cơ sở định gi&aacute; hoặc định gi&aacute; theo cảm t&iacute;nh sẽ khiến qu&yacute; vị kh&oacute; b&aacute;n ra hoặc b&aacute;n bị lỗ.<br />\r\n<br />\r\n- Để l&acirc;u kh&ocirc;ng b&aacute;n được th&igrave; d&ograve;ng tiền sẽ kh&ocirc;ng thể lưu th&ocirc;ng, c&aacute;c kế hoạch sử dụng t&agrave;i ch&iacute;nh bị tr&igrave; trệ.<br />\r\n<br />\r\n- Đưa th&ocirc;ng tin l&ecirc;n mạng th&igrave; bị l&agrave;m phiền đến mệt mỏi m&agrave; vẫn kh&ocirc;ng b&aacute;n được nh&agrave;.<br />\r\n<br />\r\n- Khi diễn ra giao dịch c&oacute; thể gặp kh&oacute; khăn trong vấn đề giấy tờ.<br />\r\n<br />\r\n- V&agrave; nhiều rắc rối xảy ra khi bị kh&aacute;ch mua nh&agrave; &quot;l&yacute; do&quot; m&agrave; qu&yacute; vị kh&ocirc;ng thể giải quyết được.</p>\r\n</blockquote>\r\n<br />\r\nH&atilde;y thoải m&aacute;i đi, đừng để c&aacute;c rắc rối n&agrave;y l&agrave;m qu&yacute; vị đau đầu. Gọi ngay cho Thanh Ph&uacute; Thịnh Land để được an t&acirc;m. Khi an t&acirc;m ch&uacute;ng ta mới s&aacute;ng suốt để xử l&yacute; mọi vấn đề được.<br />\r\n<br />\r\nThanh Ph&uacute; Thịnh Land l&agrave; đơn vị m&ocirc;i giới chuy&ecirc;n nghiệp sẽ gi&uacute;p qu&yacute; vị định gi&aacute;, b&aacute;n t&agrave;i sản ra nhanh nhất, thoải m&aacute;i nhất.<br />\r\n<br />\r\n5 L&yacute; do để chọn ch&uacute;ng t&ocirc;i l&agrave;m đơn vị m&ocirc;i giới cho t&agrave;i sản của qu&yacute; vị<br />\r\n<br />\r\n- Tr&ecirc;n 10 năm kinh nghiệm trong lĩnh vực m&ocirc;i giới, định gi&aacute; BĐS.<br />\r\n<br />\r\n- Kh&aacute;ch c&oacute; sẵn nhiều đảm bảo t&agrave;i sản qu&yacute; vị được b&aacute;n nhanh.<br />\r\n<br />\r\n- Quy tr&igrave;nh l&agrave;m việc đơn giản, hiệu quả.<br />\r\n<br />\r\n- Bảo mật th&ocirc;ng tin, kh&ocirc;ng để qu&yacute; vị bị l&agrave;m phiền.<br />\r\n<br />\r\n- Minh bạch r&otilde; r&agrave;ng. Tuyệt đối kh&ocirc;ng ph&aacute;t sinh chi ph&iacute;.<br />\r\n<br />\r\nQuy tr&igrave;nh l&agrave;m việc:&nbsp;<br />\r\n<br />\r\n1. Tiếp nhận th&ocirc;ng tin.<br />\r\n2. Tiếp nhận giấy tờ ph&aacute;p l&yacute;.<br />\r\n3. Định gi&aacute;.<br />\r\n4. K&yacute; Hợp đồng m&ocirc;i giới<br />\r\n5. Xử l&yacute; Media (h&igrave;nh ảnh, video).<br />\r\n6. Dẫn kh&aacute;ch.<br />\r\n7. Chốt thương vụ.<br />\r\n8. Thanh l&yacute; hợp đồng.<br />\r\n<br />\r\nKhi c&oacute; bất động sản cần b&aacute;n h&atilde;y li&ecirc;n hệ với ch&uacute;ng t&ocirc;i. Qu&yacute; vị sẽ được trải nghiệm một phong c&aacute;ch l&agrave;m việc chuy&ecirc;n nghiệp, đảm bảo b&aacute;n nhanh t&agrave;i sản, tr&aacute;nh c&aacute;c rủi ro ph&aacute;t sinh.<br />\r\n<br />\r\nHotline: 0919.356.178<br />\r\n<br />\r\n&nbsp;', '2017/10/28/ky-gui-nha-dat-1509166142.jpg', 'nhan-ky-gui-nha-dat', 1, '', '', '', '', 1, 1, '2017-10-28 11:49:53', '2017-10-28 11:49:53'),
