(166, '<strong>C&Ocirc;NG VIỆC NG&Agrave;Y 20/08/2017</strong><br />\r\nS&aacute;ng 7h xuống dự&nbsp;&aacute;n vừa&nbsp;đợi kh&aacute;ch vừa bắt kh&aacute;ch v&atilde;ng lai<br />\r\nChiều treo baner khu vực nam phong ng&atilde; tư xo&agrave;i&nbsp;đ&ocirc;i<br />\r\n<strong>KẾT QUẢ L&Agrave;M ​​​​​​VIỆC NG&Agrave;Y 20/072017</strong><br />\r\nS&aacute;ng t&igrave;m kh&aacute;ch v&atilde;ng lai rất c&oacute; hiệu quả khi c&oacute;&nbsp;đc 5 kh&aacute;ch c&oacute; số 4 kh&aacute;ch nhưng chỉ c&oacute; 1 kh&aacute;ch v&agrave;o dự&nbsp;&aacute;n nhưng kh&ocirc;ng th&iacute;ch<br />\r\n&nbsp;', 4, '<strong>C&Ocirc;NG VIỆC NG&Agrave;Y 20/08/2017</strong><br />\r\nS&aacute;ng 7h xuống dự&nbsp;&aacute;n vừa&nbsp;đợi kh&aacute;ch vừa bắt kh&aacute;ch v&atilde;ng lai<br />\r\nChiều treo baner khu vực nam phong ng&atilde; tư xo&agrave;i&nbsp;đ&ocirc;i<br />\r\n<strong>KẾT QUẢ L&Agrave;M ​​​​​​VIỆC NG&Agrave;Y 20/072017</strong><br />\r\nS&aacute;ng t&igrave;m kh&aacute;ch v&atilde;ng lai rất c&oacute; hiệu quả khi c&oacute;&nbsp;đc 5 kh&aacute;ch c&oacute; số 4 kh&aacute;ch nhưng chỉ c&oacute; 1 kh&aacute;ch v&agrave;o dự&nbsp;&aacute;n nhưng kh&ocirc;ng th&iacute;ch<br />\r\n&nbsp;', '2017-08-25', 'B&aacute;o c&aacute;o ng&agrave;y 25/08, lại ghi c&ocirc;ng việc của ng&agrave;y 20/08, được bao nhi&ecirc;u kh&aacute;ch ghi r&otilde; số điện thoại, treo được bao nhi&ecirc;u tờ baner ghi r&otilde; số lượng.', 3, 0, 9, 10, 4, '2017-08-25 16:29:01', '2017-08-30 12:19:11'),
(167, '<span style=\"font-size:20px\"><strong>C&Ocirc;NG VIỆC NG&Agrave;Y 24/08/2017</strong><br />\r\nS&aacute;ng xuống dự&nbsp;&aacute;n sớm khoảng 7h t&igrave;m kh&aacute;ch v&atilde;ng lai<br />\r\n10h gặp kh&aacute;ch tư vấn kh&aacute;ch&nbsp;ở dự&nbsp;&aacute;n Phước L&acirc;m từ&nbsp;đăng tin<br />\r\n12h gặp kh&aacute;ch tư vấn tiếp&nbsp;ở phước l&acirc;m v&agrave; mỹ lộc từ sale phone<br />\r\n3h tiếp kh&aacute;ch từ baner xem&nbsp;đất&nbsp;ở mỹ lộc thanh ba v&agrave; lộc tiền<br />\r\n1h30-3h&nbsp;đăng tin ch&ocirc;ttot.vn, mogi.net</span><br />\r\n&nbsp;', 4, '<span style=\"font-size:20px\"><strong>C&Ocirc;NG VIỆC NG&Agrave;Y 24/08/2017</strong><br />\r\nS&aacute;ng xuống dự&nbsp;&aacute;n sớm khoảng 7h t&igrave;m kh&aacute;ch v&atilde;ng lai<br />\r\n10h gặp kh&aacute;ch tư vấn kh&aacute;ch&nbsp;ở dự&nbsp;&aacute;n Phước L&acirc;m từ&nbsp;đăng tin<br />\r\n12h gặp kh&aacute;ch tư vấn tiếp&nbsp;ở phước l&acirc;m v&agrave; mỹ lộc từ sale phone<br />\r\n3h tiếp kh&aacute;ch từ baner xem&nbsp;đất&nbsp;ở mỹ lộc thanh ba v&agrave; lộc tiền<br />\r\n1h30-3h&nbsp;đăng tin ch&ocirc;ttot.vn, mogi.net</span>', '2017-08-25', 'ghi r&otilde; nội dung c&ocirc;ng việc, gặp kh&aacute;ch h&agrave;ng v&agrave; t&igrave;nh trạng kh&aacute;ch h&agrave;ng phản hồi về dự &aacute;n m&igrave;nh như thế n&agrave;o?<br />\r\nem ghi r&otilde; để anh nắm v&agrave; phản hồi lại nh&eacute;', 2, 0, 9, 10, 4, '2017-08-25 16:33:32', '2017-09-20 15:36:59'),
(168, '<strong>C&Ocirc;NG VIỆC NG&Agrave;Y 25/08/2017</strong><br />\r\nS&aacute;ng&nbsp;đăng tin&nbsp;ở chotot&nbsp;đc 3 tin v&agrave; muaban.net<br />\r\n9h&nbsp;đi theo d&otilde;i người ph&aacute;t tờ rơi&nbsp;đến 2h<br />\r\nChiều 3h&nbsp;ở văn ph&ograve;ng&nbsp;đăng tin&nbsp;đc khoảng 5 tin v&agrave;&nbsp;điện thoại chăm s&oacute;c kh&aacute;ch<br />\r\n&nbsp;', 4, '<strong>C&Ocirc;NG VIỆC NG&Agrave;Y 25/08/2017</strong><br />\r\nS&aacute;ng&nbsp;đăng tin&nbsp;ở chotot&nbsp;đc 3 tin v&agrave; muaban.net<br />\r\n9h&nbsp;đi theo d&otilde;i người ph&aacute;t tờ rơi&nbsp;đến 2h<br />\r\nChiều 3h&nbsp;ở văn ph&ograve;ng&nbsp;đăng tin&nbsp;đc khoảng 5 tin v&agrave;&nbsp;điện thoại chăm s&oacute;c kh&aacute;ch<br />\r\n&nbsp;', '2017-08-25', 'Đăng tin sao ko copy link b&aacute;o c&aacute;o em<br />\r\n- Đăng tin qu&aacute; &iacute;t th&igrave; lấy đ&acirc;u ra kh&aacute;ch em, r&agrave;nh thời gian nhiều hơn để t&igrave;m kiếm kh&aacute;ch h&agrave;ng mới<br />\r\n- Cần phải c&oacute; sự s&aacute;ng tạo mới trong c&aacute;ch l&agrave;m, ko n&ecirc;n rập khu&ocirc;n theo lối m&ograve;n, như vậy mất thời gian v&agrave; ko hiệu quả từ đ&oacute; dẫn đến sự ch&aacute;n nản, ko tập trung, l&ecirc;n bảng kế hoạch tuần l&agrave;m việc cho anh.<br />\r\nCho anh mục ti&ecirc;u trong tuần l&agrave; phải l&agrave;m những g&igrave;<br />\r\nV&agrave; c&oacute; được bao nhi&ecirc;u giao dịch<br />\r\nHay thay đổi bản th&acirc;n một c&aacute;ch t&iacute;ch cực rồi bạn sẽ thấy sự may mắn v&agrave; hiệu quả sẽ đến!<br />\r\n&nbsp;', 2, 0, 9, 10, 4, '2017-08-25 16:35:44', '2017-08-30 12:34:24'),
